Gadgets','gadgets','','',0,0,'0000-00-00 00:00:00',1,'{\"category_layout\":\"\",\"image\":\"\"}','','','{\"author\":\"\",\"robots\":\"\"}',989,'2013-07-09 17:55:14',0,'0000-00-00 00:00:00',0,'*'),(16,57,1,29,30,1,'makeover','com_contact','MAKEOVER','makeover','','',1,0,'0000-00-00 00:00:00',1,'{\"category_layout\":\"\",\"image\":\"\"}','Les presentamos a nuestro nuevo participante de Möbius Makeover.\r\n¿QUÉ ES MÖBIUS MAKEOVER? Möbius Makeover es una campaña de Möbius CrossFit en la que ayudaremos a una persona que realmente desea un cambio en su vida, a lograr sus metas de fitness.\r\n\r\nDurante cuatro meses Möbius CrossFit patrocinará servicio de entrenamiento, nutriólogo y quiropráctico, quienes supervisarán y ayudarán a la persona elegida durante el periodo de Möbius Makeover a lograr sus objetivos.\r\n','','{\"author\":\"\",\"robots\":\"\"}',989,'2013-07-22 17:28:07',989,'2013-12-03 21:24:24',0,'es-ES');
