rimer participante de Möbius Makeover.','Diseñador Gráfico.','','','Diseñador Gráfico.','','Jhonny Ayin ','88 KG.','','images/imagen-primera-edicion.png',NULL,'',0,1,0,'0000-00-00 00:00:00',6,'{\"show_contact_category\":\"\",\"show_contact_list\":\"\",\"presentation_style\":\"\",\"show_name\":\"\",\"show_position\":\"\",\"show_email\":\"\",\"show_street_address\":\"\",\"show_suburb\":\"\",\"show_state\":\"\",\"show_postcode\":\"\",\"show_country\":\"\",\"show_telephone\":\"\",\"show_mobile\":\"\",\"show_fax\":\"\",\"show_webpage\":\"\",\"show_misc\":\"\",\"show_image\":\"\",\"allow_vcard\":\"\",\"show_articles\":\"\",\"show_profile\":\"\",\"show_links\":\"\",\"linka_name\":\"\",\"linka\":null,\"linkb_name\":\"\",\"linkb\":null,\"linkc_name\":\"\",\"linkc\":null,\"linkd_name\":\"\",\"linkd\":null,\"linke_name\":\"\",\"linke\":\"\",\"contact_layout\":\"\",\"show_email_form\":\"\",\"show_email_copy\":\"\",\"banned_email\":\"\",\"banned_subject\":\"\",\"banned_text\":\"\",\"validate_session\":\"\",\"custom_reply\":\"\",\"redirect\":\"\"}',0,16,1,'24','http://Diseñador Gráfico.','','','','es-ES','2013-07-22 17:35:42',989,'','2013-12-03 21:27:56',989,'','Les presentamos a nuestro nuevo participante de Möbius Makeover.¿QUÉ ES MÖBIUS MAKEOVER? Möbius Makeover es una campaña de Möbius CrossFit en la que ayudaremos a una persona que realmente desea un cambio en su vida, a lograr sus metas de fitness.\r\n\r\nDurante cuatro meses Möbius CrossFit patrocinará servicio de entrenamiento, nutriólogo y quiropráctico, quienes supervisarán y ayudarán a la persona elegida durante el periodo de Möbius Makeover a lograr sus objetivos.\r\n','{\"robots\":\"\",\"rights\":\"\"}',0,'','0000-00-00 00:00:00','0000-00-00 00:00:00'),(12,'SEGUNDA EDICIÓN','segunda-edicion','Les presentamos al segundo participante de Möbius Makeover.','Todo comienza con cada día al salir de la ducha y te repites la misma frase “¿Ahora que me pongo?” después de meditarlo y correr toda la ropa del closet de lado a lado terminamos con el “uniforme” del lunes, o del martes o del miércoles y todo el resto de ropa, la “nice” o la “buena” se queda colgada porque simplemente o no cierra o no entra y terminamos con esos jeans que ya empiezan a verse blanqueados de las piernas.\r\nMido cerca de 1.68 y mi peso debe haber rebasado las 3 cifras.\r\nSoy Arquitecto, tengo 39 años y estoy haciendo un cambio total en mi vida, un cambio por mi salud y por mis tres hijos. Después de 24 años de fumar y varios casos de cáncer en mi familia, decidí dejarlo de un día al otro, hoy ya son 6 semanas. \r\nLa crisis económica, como nos pasa a muchos de nosotros en Cancún, las presiones diarias del trabajo y casa, entre otros, terminan refugiándome en la comida chatarra y el sedentarismo, y es por eso que dentro de mi búsqueda por una versión más sana de mí mismo que quiero formar parte de su programa, además de que le prometí a mi hijo el mayor (16) que dentro de 2 años nos inscribiríamos juntos a la Amazing Race, por lo que tengo que trabajar en recuperar mi condición física.\r\nNecesito de Möbius para recuperar mi salud, mi fuerza y mi atractivo.\r\n','','','Diseñador Gráfico.','','Pablo Romero Zozaya','88 KG.','','images/makeover2_ciompletado.jpg',NULL,'',0,1,0,'0000-00-00 00:00:00',6,'{\"show_contact_category\":\"\",\"show_contact_list\":\"\",\"presentation_style\":\"\",\"show_name\":\"\",\"show_position\":\"\",\"show_email\":\"\",\"show_street_address\":\"\",\"show_suburb\":\"\",\"show_state\":\"\",\"show_postcode\":\"\",\"show_country\":\"\",\"show_telephone\":\"\",\"show_mobile\":\"\",\"show_fax\":\"\",\"show_webpage\":\"\",\"show_misc\":\"\",\"show_image\":\"\",\"allow_vcard\":\"\",\"show_articles\":\"\",\"show_profile\":\"\",\"show_links\":\"\",\"linka_name\":\"\",\"linka\":null,\"linkb_name\":\"\",\"linkb\":null,\"linkc_name\":\"\",\"linkc\":null,\"linkd_name\":\"\",\"linkd\":null,\"linke_name\":\"\",\"linke\":\"\",\"contact_layout\":\"\",\"show_email_form\":\"\",\"show_email_copy\":\"\",\"banned_email\":\"\",\"banned_subject\":\"\",\"banned_text\":\"\",\"validate_session\":\"\",\"custom_reply\":\"\",\"redirect\":\"\"}',0,16,1,'39','http://Diseñador Gráfico.','','','','es-ES','2013-07-22 17:35:42',989,'','2014-03-21 06:57:50',989,'','Les presentamos a nuestro nuevo participante de Möbius Makeover. ¿QUÉ ES MÖBIUS MAKEOVER? Möbius Makeover es una campaña de Möbius CrossFit en la que ayudaremos a una persona que realmente desea un cambio en su vida, a lograr sus metas de fitness.\r\n\r\nDurante cuatro meses Möbius CrossFit patrocinará servicio de entrenamiento, nutriólogo y quiropráctico, quienes supervisarán y ayudarán a la persona elegida durante el periodo de Möbius Makeover a lograr sus objetivos.\r\n','{\"robots\":\"\",\"rights\":\"\"}',0,'','0000-00-00 00:00:00','0000-00-00 00:00:00');
