 votando por medio de Likes.</p>\r\n</div>\r\n<div id=\"formulario_img\" class=\"span5 offset1\"><img src=\"images/formulario-bloqueado.jpg\" border=\"0\" alt=\"\" /></div>\r\n<!--div id=\"formulario\"><form id=\"form_make_over\" action=\"templates/mobiuscrossfitcancn/enviar_datos_makeover.php\" method=\"POST\" enctype=\"multipart/form-data\" target=\"_self\">\r\n<h1>¿POR QUÉ ERES EL CANDIDATO IDEAL?</h1>\r\n<div class=\"divInputs\"><label>Nombre:</label> <input class=\"required inputbox nombre\" type=\"text\" name=\"Nombre\" size=\"40\" /></div>\r\n<div class=\"divInputs\"><label>E-Mail:</label> <input class=\"required inputbox email\" type=\"text\" name=\"Correo\" size=\"40\" /></div>\r\n<div class=\"divInputs\"><label>Teléfono:</label> <input class=\"required inputbox\" type=\"text\" name=\"Telefono\" size=\"40\" /></div>\r\n<div class=\"divInputs\"><label>Sube tu foto:</label> <input class=\"required inputbox\" style=\"background-color: white;\" type=\"file\" name=\"archivo1\" size=\"40\" /></div>\r\n<div class=\"divInputs\"><label>Explícanos por qué eres el candidato ideal:</label> <textarea id=\"comments\" class=\"required\" name=\"Soy el candidato ideal porque : \" rows=\"9\" cols=\"50\"></textarea></div>\r\n<div class=\"divInputs required\"><input id=\"enviar_makeover\" type=\"image\" value=\"\" src=\"images/sendButton_makeover.png\" /></div>\r\n</form></div--></div>\r\n<div class=\"separador\"> </div>\r\n<div class=\"subsecciones row-fluid\">{loadposition 1001}</div>','',1,0,0,2,'2013-07-22 15:26:08',989,'','2014-04-04 19:48:39',989,0,'0000-00-00 00:00:00','2013-07-22 15:26:08','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{