l\" style=\"margin-bottom: .0001pt;\"><span style=\"font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif; background-position: initial initial; background-repeat: initial initial;\">4 High pull Clean (135/105)</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt;\"><span style=\"font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif; background-position: initial initial; background-repeat: initial initial;\"> </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt;\"><span style=\"font-size: 10pt; line-height: 115%; font-family: Arial, sans-serif; background-position: initial initial; background-repeat: initial initial;\">12 T2B</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt;\"> </p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt;\"> </p>\r\n<p style=\"margin: 0cm; margin-bottom: .0001pt; mso-line-height-alt: 11.25pt;\"><span style=\"font-family: \'Arial\',\'sans-serif\';\"> </span></p>\r\n<p style=\"margin: 0cm; margin-bottom: .0001pt; mso-line-height-alt: 11.25pt;\"><em><strong><span style=\"font-family: \'Arial\',\'sans-serif\';\">Anuncios:</span></strong></em></p>\r\n<p style=\"margin: 0cm; margin-bottom: .0001pt; mso-line-height-alt: 11.25pt;\"><span style=\"font-family: \'Arial\',\'sans-serif\';\"> -Recuerda usar el estacionamiento en la parte de abajo.<br /> -Hacer check in 10 minutos antes del WOD.<br /> -Si aún no nos sigues en Facebook regálanos un \"Me Gusta\" o síguenos en Twitter.</span></p>\r\n<p> </p>','',-2,0,0,8,'2013-07-31 14:26:39',989,'','2013-09-02 18:09:19',989,0,'0000-00-00 00:00:00','2013-07-31 14:26:39','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',5,0,2,'','',1,19,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',1,'*',''),(52,97,'Beneficios de incluir aceite de pescado en tu dieta.','beneficios-de-incluir-aceite-de-pescado-en-tu-dieta','','<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><strong>Beneficios de incluir Aceite de pescado a tu dieta.</strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\">Muchos se preguntan si el aceite de pescado es bueno o no.La respuesta es sí.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\">Por lo general los atletas se interesan por el aceite de pescado debido a sus beneficios para la composición corporal,  aunque cualquier persona puede mejorar su estado de salud en general ingiriendo estas grasas naturales.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"> </p>\r\n<p class=\"MsoNormal\"> <img src=\"images/3f44eb30662b7731f8c3e018085078ec.jpg\" border=\"0\" alt=\"Aceite de pescado\" title=\"Beneficios del aceite de pescado\" width=\"500\" height=\"450\" style=\"border: 0px; display: block; margin-left: auto; margin-right: auto;\" /></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"> </p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><strong>Ahora, te preguntarás qué contiene el aceite de pescado que lo hace tan beneficioso.</strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\">Los componentes activos principales del aceite de pescado son EPA y DHA. En el organismo, los ácidos grasos EPA y DHA se almacenan en la bicapa fosfolipídica de células para usarlos en el futuro. Esto puede afectar en gran medida a los procesos que utilizan estos lípidos (grasas) almacenados.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\">También contiene propiedades antioxidantes y desinflamatorias. Ideal para las personas que hacen ejercicios de alta intensidad y OLY, el aceite de pescado puede ser beneficioso para la recuperación posterior al ejercicio.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"> </p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><strong>Ayuda a desarrollar masa muscular</strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\">Si estás interesado(a) en desarrollar músculo, este suplemento es ideal ya que ayuda en la síntesis y limita la degradación del proteínas muscular. Esto significa un menor deterioro y mayor desarrollo muscular. Además, hay indicios de que EPA y DHA apoyan la función de la insulina y aumentan la absorción de glucosa y ácidos grasos en las células musculares. Esto ayuda a distribuir los nutrientes hacia el músculo y alejarlos de la grasa, lo cual mejora la composición corporal general y proporciona más combustible al músculo durante el ejercicio.</p>\r\n<p class=\"MsoNormal\"> <img src=\"images/c2a9d01e6e4d3c9e68819ae73fb69a84.jpg\" border=\"0\" alt=\"Desarrolla músculos\" title=\"Desarrolla músculos\" width=\"500\" height=\"500\" style=\"cursor: se-resize !important; display: block; margin-left: auto; margin-right: auto;\" /></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"><strong>¿Cómo incorporarlo a tu dieta?</strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\">Para aprovechar los beneficios de estos dos ácidos grasos en el metabolismo muscular y en la composición corporal, asegúrate de consumir entre 2 y 4 g de EPA y DHA combinados al día.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\">También puedes combinar el aceite de pescado con tus suplementos básicos habituales como multivitamínicos. Te recomendamos buscar suplementos que contengan una elevada concentración de estos ácidos grasos.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\">Por último puedes incluir pescado frito o la plancha a tu dieta ya que contiende ácidos grasos en especial EPA y DHA.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"> </p>\r\n<p class=\"MsoNormal\"><img src=\"images/e3f43400496375b0321a15556437b9c4.jpg\" border=\"0\" alt=\"Pescado a la plancha\" title=\"Pescado a la plancha\" style=\"display: block; margin-left: auto; margin-right: auto;\" /></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"> </p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; text-justify: inter-ideograph;\"> </p>','',1,0,0,12,'2013-10-25 19:08:40',989,'','2013-10-25 19:09:00',989,0,'0000-00-00 00:00:00','2013-10-25 19:08:40','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,0,11,'Fitness, suplementos, aceite de pescado, CrossFit, entrenamiento, alimentación, Tips','Beneficios de incluir aceite de pescado en tu dieta.',1,684,'{\"robots\":\"\",\"author\":\"M\\u00f6bius CrossFit\",\"rights\":\"\",\"xreference\":\"\"}',1,'*',''),(53,98,'#MöbiusMakeover Primera Edición','moebiusmakeover-primera-edicion','','<p style=\"text-align: center;\"><strong>Mobius Makeover primera edición.</strong></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\">El día de hoy concluye oficialmente la primera edición de nuestro programa #MöbiusMakeover en el cual buscamos que los participantes hagan un cambio y experimenten una mejoría en sus vidas.</p>\r\n<p style=\"text-align: justify;\">Durante 4 meses Möbius CrossFit patrocina entrenamiento gratuito, asesoría con un experto en nutrición y consultas con un quiropráctico en esta primera edición, Jhonny Ayín fue nuestro candidato quien demostró gran audacia para hacer los WODs y sobre todo una gran disciplina que lo ayudó a lograr increíbles resultados.</p>\r\n<p><img src=\"images/makeover1.png\" border=\"0\" alt=\"\" /></p>\r\n<p style=\"text-align: justify;\">Queremos felicitar y agradecer a Jhonny por la confianza depositada en Möbius CrossFit y permitirnos ser parte de este proceso de cambio en su vida, a la nutrióloga Rosa Irene Campos quien lo apoyó con programas de alimentación especialmente diseñados para Jhonny y Dashel Alarcón, quiropráctico quien cuidó a nuestro participante para estar al 100% en los entrenamientos.</p>\r\n<p style=\"text-align: justify;\">En CrossFit  somos una comunidad de personas que buscan superarse y lograr ser la mejor versión de si mismas. #MöbiusMakeover nace con la finalidad de ayudar a las personas que realmente están buscando un cambio integral brindándole las herramientas indispensables para explotar sus ganas de superarse.</p>\r\n<p style=\"text-align: justify;\">Este proceso no hubiera sido posible sin el gran compromiso que demostró Jhonny durante el reto así como el gran cuidado que le  brindaron nuestros asesores especializados.</p>\r\n<p style=\"text-align: justify;\">Aquí los resultados.</p>\r\n<p><img src=\"images/1395260_532865843475074_1886496446_n.jpg\" border=\"0\" alt=\"Resultados Mobius Makeover\" title=\"Resultados Mobius Makeover\" width=\"600\" height=\"500\" style=\"border: 0;\" /></p>','',1,0,0,12,'2013-11-01 19:32:59',989,'','2013-11-01 19:34:42',989,0,'0000-00-00 00:00:00','2013-11-01 19:32:59','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,0,10,'Mobius Makeover, perder peso, crossfit, cancún, nutrición, quiropráctico','Este es nuestro primer caso de éxito de #MöbiusMakeover ',1,906,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',1,'*',''),(58,103,'Y tú ¿Amas u odias los burpees?','y-tu-amas-u-odias-los-burpees','','<p class=\"p1\" style=\"text-align: center;\"><strong>Y tú ¿Amas u odias los burpees?</strong></p>\r\n<p class=\"p2\"> </p>\r\n<p class=\"p3\" style=\"text-align: justify;\">Típico que planeas meterte a CrossFit y la gente que ya lo practica te platica pestes de los burpees. Quizás es porque en muchos boxes son utilizados como castigo al llegar tarde.</p>\r\n<p class=\"p2\" style=\"text-align: center;\"><img src=\"images/imagenes-burpee.png\" border=\"0\" alt=\"Burpees\" title=\"Burpees\" width=\"530\" height=\"400\" style=\"border: 0;\" /></p>\r\n<p class=\"p4\" style=\"text-align: justify;\"><span class=\"s1\">O quizás sea porque los </span>burpees combinan sentadillas, flexiones y salto vertical en una secuencia de movimientos realizados en rápida sucesión y son considerados como el máximo ejercicio de peso corporal.</p>\r\n<p class=\"p4\" style=\"text-align: justify;\">Amados u odiados es una realidad que los burpees dan resultados y para obtenerlos necesitas hacernos correctamente.</p>\r\n<p class=\"p5\"> </p>\r\n<p class=\"p5\"><img src=\"images/burpee.jpg\" border=\"0\" alt=\"Cómo hacer un burpee\" width=\"500\" height=\"350\" style=\"border: 0px; display: block; margin-left: auto; margin-right: auto;\" /></p>\r\n<p class=\"p5\"> </p>\r\n<p class=\"p5\"> </p>\r\n<p class=\"p6\"> </p>\r\n<p class=\"p6\"> </p>\r\n<p class=\"p7\" style=\"text-align: justify;\">1.-Con tus pies juntos has una sentadilla hacia abajo y posteriormente coloca tus manos en el suelo justo en frente de tus pies.</p>\r\n<p class=\"p7\" style=\"text-align: justify;\">2.-Mantén tus pies juntos e impúlsalos de un salto hacia atrás, a manera de quedar en posición de plancha.</p>\r\n<p class=\"p7\" style=\"text-align: justify;\">3.-Dobla los brazos y has una sola flexión.</p>\r\n<p class=\"p7\" style=\"text-align: justify;\">4.-Regresa a la posición de plancha y regresa de un salto los pies juntos bajo tu cuerpo y de ahí realiza un salto vertical.</p>\r\n<p class=\"p7\" style=\"text-align: justify;\">5.-Aterriza con las piernas ligeramente flexionadas y repite.</p>\r\n<p class=\"p8\" style=\"text-align: justify;\"> </p>\r\n<p class=\"p7\" style=\"text-align: justify;\">Los burpees pueden ser adaptados en varias formas para hacerlos mas sencillos o difíciles. Los principiantes pueden omitir la flexión y el salto vertical.</p>\r\n<p class=\"p7\" style=\"text-align: justify;\">Los avanzados pueden añadir un obstáculo a saltar al frente o a los lados entre cada repetición. También pueden usar un chaleco con peso o sostener mancuernas. Algunos hasta agregar una flexión de barra entre cada repetición.</p>\r\n<p class=\"p7\" style=\"text-align: left;\">Es importante que tengas la supervisión de coaches certificados de CrossFit que te puedan asesorar en todo momento. Puedes venir a tres clases prueba haciendo click aquí : <a href=\"https://www.facebook.com/MobiusCrossfit/app_670522276310483\" target=\"_blank\">https://www.facebook.com/MobiusCrossfit/app_670522276310483</a></p>\r\n<p class=\"p7\"><img src=\"images/596d833017a1c8d05526bca7a3399554.jpg\" border=\"0\" width=\"500\" height=\"400\" style=\"border: 0px; display: block; margin-left: auto; margin-right: auto;\" /></p>\r\n<p> </p>\r\n<p class=\"p8\" style=\"text-align: justify;\">¿Y tú qué opinas de los burpees? Los amas o los odias. </p>\r\n<p class=\"p8\" style=\"text-align: justify;\">#Fuerza</p>','',1,0,0,12,'2013-11-12 19:26:04',989,'','2013-11-12 19:33:05',989,0,'0000-00-00 00:00:00','2013-11-12 19:26:04','0000-00-00 00:00:00','{\"image_intro\":\