la salud y el bienestar, como la palabra lo dice “bien – estar” va más allá de sólo hacer ejercicio. En Möbius vas a encontrar profesionales que te llevarán a encontrar un estilo de vida donde la prioridad es tu salud. Desde una correcta alimentación, mantenimiento a nuestro cuerpo con profesionales en Fisioterapia, quiropráctica. Un correcto régimen de entrenamiento de menos a más según tus necesidades y habilidades. En Möbius encontrarás una atmósfera de equipo donde es igual de importante el último en terminar el WOD (Workout of the day) así como el primero. No te dejaremos renunciar, será la mejor manera de alcanzar tus metas de fitness, es más que sólo ir a hacer ejercicio, es una competencia contigo mismo donde la batalla puede ser poder ejecutar una lagartija, hasta una sentadilla de 300kg. Depende de ti y el equipo de Möbius estará cuidándote en cual quiera que sea tu meta.',1,56,'{\"robots\":\"\",\"author\":\"M\\u00f6bius CrossFit Canc\\u00fan\",\"rights\":\"\",\"xreference\":\"\"}',1,'es-ES',''),(90,135,'Home','home','','<div class=\"w-mobius row-fluid text-center\">\r\n<h1>¿QUÉ ES MÖBIUS?</h1>\r\n<p>En Möbius somos un equipo apasionado por el deporte, la salud y el bienestar, como la palabra lo dice “bien – estar” va más allá de sólo hacer ejercicio. En Möbius vas a encontrar profesionales que te llevarán a encontrar un estilo de vida donde la prioridad es tu salud. Desde una correcta alimentación, mantenimiento a nuestro cuerpo con profesionales en Fisioterapia, quiropráctica. Un correcto régimen de entrenamiento de menos a más según tus necesidades y habilidades. En Möbius encontrarás una atmósfera de equipo donde es igual de importante el último en terminar el WOD (Workout of the day) así como el primero. No te dejaremos renunciar, será la mejor manera de alcanzar tus metas de fitness, es más que sólo ir a hacer ejercicio, es una competencia contigo mismo donde la batalla puede ser poder ejecutar una lagartija, hasta una sentadilla de 300kg. Depende de ti y el equipo de Möbius estará cuidándote en cual quiera que sea tu meta.</p>\r\n</div>\r\n<div class=\"w-crossfit row-fluid text-center\">\r\n<h2>¿QUÉ ES CROSSFIT?</h2>\r\n<p>\"Movimientos funcionales, constantemente variados, realizados a alta intensidad para obtener un estado físico de fitness completo y, por tanto, estar preparado para cualquier reto físico.\" - Cortesía de CrossFit Inc.</p>\r\n</div>\r\n<div class=\"m-crossfit row-fluid text-center\">\r\n<h2>MITOS DEL CROSSFIT</h2>\r\n<p>CrossFit es sólo para hombres. <span class=\"falso\">Falso.</span></p>\r\n<p>Para entrar a CrossFit debo tener un alto rendimiento. <span class=\"falso\">Falso.</span></p>\r\n<p>CrossFit sólo tiene un nivel: DIFÍCIL. <span class=\"falso\">Falso.</span></p>\r\n<p>En CrossFit te obligaremos a revolcarte en <br /> el lodo mientras te gritamos para animarte. <span class=\"falso\">Falso.</span></p>\r\n<p>CrossFit estimula el crecimiento exagerado de masa muscular. <span class=\"falso\">Falso.</span></p>\r\n</div>','',1,0,0,8,'2014-01-08 05:12:32',989,'','2014-08-20 17:59:31',989,0,'0000-00-00 00:00:00','2014-01-08 05:12:32','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_rea