:00',0,0,'0000-00-00 00:00:00','2014-01-14 14:10:08','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,2,'','',1,0,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(96,141,'Mitos y Realidades del CrossFit','mitos-y-realidades-del-crossfit','','<p class=\"p1\" style=\"text-align: justify;\"><br class=\"Apple-interchange-newline\" />El ser humano tiene patrones de movimientos básicos que ha desarrollado durante su evolución como especie a lo largo de miles de años. Desplazarse, traccionar, empujar o saltar, son innatos a la mecánica humana y éste es el principio del CrossFit, emular y reproducir movimientos naturales y funcionales. Por esto es un sistema que todos pueden comenzar a utilizar sin requerir cualidades o técnicas extraordinarias.</p>\r\n<p class=\"p1\" style=\"text-align: justify;\">Sus tres pilares principales son variado, funcional e intenso.</p>\r\n<p class=\"p1\"><img src=\"images/evolution.jpg\" border=\"0\" alt=\"\" /></p>\r\n<p class=\"p1\" style=\"text-align: justify;\">Existen muchos mitos sobre el CrossFit y creemos importante que sepas la realidad.</p>\r\n<p class=\"p1\" style=\"text-align: justify;\"><strong>Mito:</strong> CrossFit incluye programas muy exigentes ideados para personas y deportistas experimentados con alta condición y rendimiento físico. </p>\r\n<p class=\"p1\" style=\"text-align: justify;\"><span class=\"s2\"><strong>Realidad:</strong> CrossFit es para todo aquel que quiera esforzarse por cambiar. E</span>xisten programas menos exigentes en cuanto a dificultad, técnica e intensidad, ya que en CrossFit los ejercicios son progresivos y cada persona va al ritmo que su cuerpo le permite, adquiriendo cada vez más resistencia y fuerza.</p>\r\n<p class=\"p1\" style=\"text-align: justify;\"><img src=\"images/e891841c885b62324ce7410ebc2f79a2.jpg\" border=\"0\" alt=\"todos pueden hacer crossfit\" /></p>\r\n<p class=\"p1\" style=\"text-align: justify;\"><strong>Mito</strong>: En Crossfit lastimas las articulaciones.</p>\r\n<p class=\"p1\" style=\"text-align: justify;\"><strong>Realidad: </strong>Cualquier ejercicio mal ejecutado puede llegar a lastimarte, esto ocurre porque no escuchamos al cuerpo, tenemos que estar conscientes de que estamos empezando a hacer ejercicios nuevos y aprender a darle al cuerpo el tiempo necesario para adaptarse y  evitar lesiones. En Möbius encontrarás coaches certificados por CrossFit Inc. que podrán ayudarte en todo momento a realizar correctamente los movimientos, te indicarán los pesos adecuados, los ejercicios específicos para tus aptitudes y te retarán a trabajar con cuidado y perseverancia en aquellos skills que se te dificulten.</p>\r\n<p class=\"p2\"><img src=\"images/burpee.jpg\" border=\"0\" width=\"600\" height=\"400\" /></p>\r\n<p class=\"p1\" style=\"text-align: justify;\"><strong>Mito: </strong>Necesitas ser delgado y tener condición para hacer CrossFit</p>\r\n<p class=\"p1\" style=\"text-align: justify;\"><strong>Realidad: </strong>Al contrario de lo que muchos piensan, haciendo CrossFit es como conseguirás un cuerpo atlético.Te darás cuenta que al integrar movimientos funcionales en alta intensidad tu cuerpo adquirirá rápidamente una condición envidiable y como consecuencia perderás peso.</p>\r\n<p class=\"p1\"><img src=\"images/makeover1.png\" border=\"0\" alt=\"\" /></p>\r\n<p class=\"p1\" style=\"text-align: justify;\"><strong>Mito:</strong> Con CrossFit adquieres mucha masa muscular.</p>\r\n<p class=\"p1\" style=\"text-align: justify;\"><strong>Realidad:</strong> Conseguirás un cuerpo atlético, marcado, sin excesiva masa muscular, esto debido a que muchos de los ejercicios que realizamos son cardiovasculares, en un WOD (workout of the day) podrás correr, brincar, hacer sentadillas, push ups etc. Si quieres adquirir mayor masa muscular y a su vez mejor técnica en el levantamiento de pesas, puedes complementar tus WODs practicando con el coach Nacho en sus clases de OLY.</p>\r\n<p class=\"p2\"><img src=\"images/rich.jpg\" border=\"0\" width=\"600\" height=\"400\" /></p>\r\n<p class=\"p1\" style=\"text-align: justify;\"><strong>Mito:</strong> Las mujeres que practican Crossfit tienden a lucir un cuerpo varonil. </p>\r\n<p class=\"p1\" style=\"text-align: justify;\"><strong>Realidad: </strong>Si quieres tonificar tu cuerpo, lucir atlética y sana. El CrossFit es para ti, es muy importante que te acerques a tu coach para que compartas qué es lo que quieres lograr con tu físico, ellos sabrán darte los pesos adecuados y tips de alimentación.</p>\r\n<p class=\"p1\"><img src=\"images/woman-crossfit-torrance.jpg\" border=\"0\" alt=\"\" /></p>\r\n<p class=\"p1\" style=\"text-align: justify;\">Con la mejor actitud hacia el esfuerzo intenso y la perseverancia, aprenderás a utilizar tu cuerpo al máximo, te convertirás en un atleta integral y harás del CrossFit un estilo de vida que sacará lo mejor de ti.</p>\r\n<p class=\"p1\" style=\"text-align: justify;\">Piérdele el miedo al cambio y empieza tomando tres clases de prueba registrándote <a href=\"https://www.facebook.com/MobiusCrossfit/app_670522276310483\">AQUÍ</a></p>\r\n<p class=\"p1\" style=\"text-align: justify;\"> </p>','',1,0,0,12,'2014-01-14 21:52:41',989,'','2014-01-14 21:56:40',989,0,'0000-00-00 00:00:00','2014-01-14 21:52:41','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',3,0,9,'CrossFit, Fitness, Cancún, Bajar de Peso, ejercicio para tosos.','',1,1230,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',1,'*',''),(97,142,'W.O.D.- 15/01/2014','w-o-d-15-01-2014','','<p><img src=\"images/541826_10151185689525756_2138099706_n.jpg\" border=\"0\" alt=\"\" width=\"364\" height=\"241\" /></p>\r\n<p> </p>\r\n<p><strong style=\"color: #222222; font-size: 13px; line-height: normal;\">WOD</strong></p>\r\n<p><strong style=\"color: #222222; font-size: 13px; line-height: normal;\">FOR TIME</strong></p>\r\n<p> </p>\r\n<p><strong style=\"color: #222222; font-size: 13px; line-height: normal;\"><br /></strong>400 Run</p>\r\n<p> </p>\r\n<p>2