/p>\r\n<p><strong style=\"color: #222222; font-size: 13px; line-height: normal;\"> </strong></p>\r\n<p><strong style=\"color: #222222; font-size: 13px; line-height: normal;\"><br /></strong>30 Kb swings (32/16)</p>\r\n<p> </p>\r\n<p>30 Burpees</p>\r\n<p> </p>\r\n<p>30 Sit-ups</p>\r\n<p> </p>\r\n<p> </p>\r\n<p><span style=\"line-height: normal; color: #222222; font-size: small;\">Anuncios:</span></p>\r\n<div>\r\n<div><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\">-Recordar el estacionamiento en la parte de abajo.</span></span></div>\r\n<div><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\">-Hacer check in 10 minutos antes del WOD.</span></span></div>\r\n<div><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\">-Si aún no nos sigues en Facebook regálanos un \"Me Gusta\" o síguenos en Twitter.</span></span></div>\r\n</div>','',-2,0,0,10,'2014-01-23 13:32:56',989,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2014-01-23 13:32:56','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,26,'','',1,28,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(104,149,'Complementa CrossFit con Yoga','complementa-crossfit-y-yoga','','<p style=\"text-align: justify;\">Habrás escuchado comúnmente a tus compañeros en el box decir que “odian estirar” o que “son cero flexibles” y que incluso evitan cualquier ejercicio de estiramiento.</p>\r\n<p style=\"text-align: justify;\">Lamentablemente muchos CrossFitters dejan a un lado la gran importancia de elongar los músculos del cuerpo y sin saberlo están dejando a un lado un gran complemento de su entrenamiento ya que mantener los músculos flexibles y con elasticidad es muy importante para poder dominar técnicamente muchos movimientos durante el WOD. Tener flexibilidad te brinda muchos beneficios como facilitar un mejor riego sanguíneo de los músculos, así como el aporte de nutrientes y de oxígeno, mejora la coordinación, previene lesiones, mejora el rendimiento competitivo, ayuda a recuperarnos tras un entrenamiento intenso, ayuda a la rehabilitación en caso de lesiones, mejora la postura corporal, relaja el cuerpo, aumenta la amplitud de movimiento disponible en las articulaciones.</p>\r\n<p style=\"text-align: justify;\">Si bien en el box nos encargamos de hacer una serie de estiramientos antes y después del WOD, estos no son suficientes, ya que en un periodo tan corto de tiempo no logramos trabajar en la elongación de todos los grupos musculares de nuestro cuerpo. Lo ideal es estirar de 20 a 30 minutos después de cada entrenamiento. </p>\r\n<p style=\"text-align: justify;\">Muchos atletas élite de CrossFit complementan su entrenamiento con 2 o 3 sesiones de yoga a la semana. La práctica de Yoga de manera continua permite mejorar la flexibilidad sin mencionar los beneficios anti estrés que logramos por medio de los ejercicios de respiración (Pranayama) y meditación. Aunque son prácticas totalmente opuestas, la práctica de CrossFit en combinación con Yoga lograrán un equilibrio perfecto en tu cuerpo, notarás avances más rápidos en tus entrenamientos y te sentirás más tranquilo y menos estresado.</p>\r\n<p style=\"text-align: justify;\">En Möbius CrossFit pensamos en todos los detalles para que alcances tu máximo potencial, hemos desarrollado una alianza con Samadhi Yoga Shala para que complementes tus entrenamientos de CrossFit con Yoga a un precio especial de paquete.</p>\r\n<p style=\"text-align: justify;\">Conoce Samadhi Yoga Shala haciendo click <a href=\"https://www.facebook.com/SamadhiYogaShala\">AQUÍ </a></p>\r\n<p style=\"text-align: center;\"><img src=\"images/Yoga.png\" border=\"0\" alt=\"\" /></p>\r\n<p style=\"text-align: justify;\">Si quieres saber qué otras opciones tienes para estirar y ganar flexibilidad acércate a tus coaches, ellos te darán los mejores consejos para lograrlo.</p>\r\n<p> </p>','',1,0,0,12,'2014-01-23 22:10:14',989,'','2014-01-23 22:10:35',989,0,'0000-00-00 00:00:00','2014-01-23 22:10:14','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"sh