os en Twitter.</span></span></div>\r\n</div>','',-2,0,0,10,'2014-03-10 18:11:28',989,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2014-03-10 18:11:28','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,4,'','',1,12,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',1,'*',''),(129,174,'CrossFitionary','crossfitionary','','<p style=\"text-align: justify;\">Sabemos que hay algunos términos de CrossFit que no reconoces al 100% es por esto que recopilamos las definiciones de los principales términos que utilizamos y te los compartimos para que no te quedes con cara de WHAT cuando publiquemos los WODs.</p>\r\n<p style=\"text-align: justify;\"><img src=\"images/Captura de pantalla 2014-03-11 a las 13.21.39.png\" border=\"0\" alt=\"\" /></p>\r\n<p style=\"text-align: justify;\"><strong>WOD</strong> (Workout Of the Day): serie de ejercicios del día.</p>\r\n<p style=\"text-align: justify;\"><strong>AMRAP (As Many Reps As Possible):</strong> hacer el mayor número de repeticiones o rondas de un ejercicio, o serie de ejercicios, en un tiempo determinado.</p>\r\n<p style=\"text-align: justify;\"><strong>Tabata</strong> : Consiste en realizar 8 series de 20 segundos cada una, con el mayor número de repeticiones en este tiempo, con 10 segundos de descanso entre ellas.</p>\r\n<p style=\"text-align: justify;\"><strong>MetCon (Metabolic Conditioning):</strong> Acondicionamiento metabólico.</p>\r\n<p style=\"text-align: justify;\"><strong>EMOM (Every Minute On the Minute):</strong> se establece un tiempo determinado en el que cada minuto se comenzará una nueva ronda de los ejercicios.</p>\r\n<p style=\"text-align: justify;\"><strong>Benchmarks:</strong> son WOD preestablecidos con los cuales puedes medir tu progreso, comparando tus tiempos.</p>\r\n<p style=\"text-align: justify;\"><strong>Clean:</strong> movimiento de levantamiento olímpico que consiste en llevar el peso desde el suelo o muslos hasta los hombros.</p>\r\n<p style=\"text-align: justify;\"><strong>OHS (Over Head Squats):</strong> sentadilla que se hace con la barra encima de la cabeza.</p>\r\n<p style=\"text-align: justify;\"><strong>Muscle Up:</strong> movimiento que consiste en levantar el cuerpo por encima e los aros, seguido de una extensión de brazos.</p>\r\n<p style=\"text-align: justify;\"><strong>Handstand Push-Up:</strong> flexiones que se realizan con el cuerpo en vertical y posición boca abajo. Se puede realizar apoyado en una pared o manteniendo el equilibrio de todo el cuerpo.</p>\r\n<p style=\"text-align: justify;\"><strong>Thruster:</strong> combinación de sentadilla frontal con un push press -se hace con una barra o balón medicinal con extensión de brazos.</p>\r\n<p style=\"text-align: justify;\"><strong>BOX:</strong> espacio donde se practica CrossFit.</p>\r\n<p style=\"text-align: justify;\"><strong>Knees To Elbow:</strong> colgando de la barra, te doblas y recoges las piernas hasta que las rodillas toquen los codos.</p>\r\n<p style=\"text-align: justify;\"><strong>Toes To Bar:</strong> colgando de la barra y doblarse solo hasta la cintura levantar las punta de los pies para tocar la barra, después lentamente bajarlos y repetir.</p>\r\n<p style=\"text-align: justify;\"><strong>Pull-Ups:</strong> colgando de la barra con las palmas de la mano hacia ti, elevas tu cuerpo hasta llevar el pecho a la barra.</p>\r\n<p style=\"text-align: justify;\"><strong>Clean:</strong> Movimiento del levantamiento olímpico que consiste en llevar el peso desde el piso (o desde los muslos) hasta los hombros.</p>\r\n<p style=\"text-align: justify;\"><strong>Wall Ball Shots:</strong> Lanzas una pelota medicinal 3 metros hacia arriba mientras haces squats o sentadillas.</p>\r\n<p style=\"text-align: justify;\"><strong>Rx´d:</strong> Siglas para prescribed o prescrito. Los WODs señalan un peso o modalidad prescrita para los ejercicios.</p>\r\n<p style=\"text-align: justify;\"><strong>Clean &amp; Jerk:</strong> Envión. Movimiento doble o en dos fases del levantamiento olímpico.</p>\r\n<p style=\"text-align: justify;\"><strong>Snatch:</strong> Arrancada. Movimiento del levantamiento olímpico que consiste en llevar el peso desde el piso (o desde los muslos) hasta la posición “por encima de la cabeza” </p>\r\n<p style=\"text-align: justify;\"><strong>Double Under:</strong> Salto doble a la cuerda. Ejercicio con la cuerda en el que se salta una sola vez y se pasa la cuerda dos veces por debajo de los pies.</p>\r\n<p style=\"text-align: justify;\"><strong>Time Cap:</strong> Tiempo límite que tienes para realizar un wod.</p>\r\n<p style=\"text-align: justify;\"><strong>Death by:</strong> (Muerte por) Hacer el máximo de rondas dentro de un minuto, cuando el minuto acaba y no completas las rondas quiere decir que moriste por el ejercicio.</p>\r\n<p style=\"text-align: justify;\">Si tienes alguna duda o algún otro término que quieres que agreguemos escríbemos en un comentario usando el hashtag  #CrossFitionary</p>\r\n<p><img src=\"images/competition-dictionary-small-square.jpg\" border=\"0\" width=\"400\" height=\"400\" style=\"border: 0;\" /></p>\r\n<p> </p>','',1,0,0,12,'2014-03-11 21:50:34',989,'','2014-03-11 21:51:07',989,0,'0000-00-00 00:00:00','2014-03-11 21:50:34','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,0,5,'','',1,551,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',1,'*',''),(130,175,'W.O.D-13/03/2014','w-o-d-13-03-2014','','<p><span style=\"color: #222222; font-size: small; line-height: normal;\"><img src=\"images/Diapositiva1.jpg\" border=\"0\" alt=\"\" width=\"360\" height=\"219\" /> </span></p>\r\n<p><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\"><strong>STRENGTH<br /><br /></strong>Deadlift 7x3, find your 3RM</span></span></p>\r\n<p><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\"> </span></span></p>\r\n<p><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\"><strong>WOD</strong></span></span