-bar.jpg\" border=\"0\" alt=\"\" width=\"362\" height=\"241\" /></span></p>\r\n<p> </p>\r\n<p><strong>WOD</strong></p>\r\n<p><strong>EMOM 12 MIN</strong></p>\r\n<p><strong> </strong></p>\r\n<p><strong><br /></strong>Diamond push up</p>\r\n<p> </p>\r\n<p>chest push up</p>\r\n<p> </p>\r\n<p>Toes to bar</p>\r\n<p> </p>\r\n<p>odd 4 reps per exercise.</p>\r\n<p>even 7 reps per  exercise.</p>\r\n<p> </p>\r\n<p>Cash out</p>\r\n<p> </p>\r\n<p>100 Supermans</p>\r\n<p> </p>\r\n<p>100 V-situps</p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p><span style=\"color: #222222; font-size: small; line-height: normal;\">Anuncios:</span></p>\r\n<div>\r\n<div><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\">-Recordar el estacionamiento en la parte de abajo.</span></span></div>\r\n<div><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\">-Hacer check in 10 minutos antes del WOD.</span></span></div>\r\n<div><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\">-Si aún no nos sigues en Facebook regálanos un \"Me Gusta\" o síguenos en Twitter.</span></span></div>\r\n</div>','',-2,0,0,10,'2014-03-14 14:11:31',989,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2014-03-14 14:11:31','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,2,'','',1,7,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(133,178,'W.O.D-18/03/2014','w-o-d-18-03-2014','','<p><img src=\"images/1549516_395643490571106_2146079697_n.jpg\" border=\"0\" alt=\"\" width=\"365\" height=\"243\" /></p>\r\n<p><strong>WOD</strong></p>\r\n<p><strong>\"FRAN\"</strong></p>\r\n<p> </p>\r\n<p>21-15-9</p>\r\n<p> </p>\r\n<p>Thrusters (95/65)</p>\r\n<p> </p>\r\n<p>Pull-ups</p>\r\n<p> </p>\r\n<p>then</p>\r\n<p> </p>\r\n<p>2x5 Turkish gel-ups (go heavy as possible)</p>\r\n<p> </p>\r\n<p>cash out <br /><br /><br />tabata planks with weight</p>\r\n<p> </p>\r\n<p> </p>\r\n<p><span style=\"color: #222222; font-size: small; line-height: normal;\">Anuncios:</span></p>\r\n<div>\r\n<div><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\">-Recordar el estacionamiento en la parte de abajo.</span></span></div>\r\n<div><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\">-Hacer check in 10 minutos antes del WOD.</span></span></div>\r\n<div><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\">-Si aún no nos sigues en Facebook regálanos un \"Me Gusta\" o síguenos en Twitter.</span></span></div>\r\n</div>','',-2,0,0,10,'2014-03-18 14:56:21',989,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2014-03-18 14:56:21','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,1,'','',1,9,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(134,179,'El estrés es tu peor enemigo.','el-estres-es-tu-peor-enemigo','','<p style=\"text-align: justify;\">¿Sabías que cuando estás estresado produces una serie de hormonas que determinan lo que comes y cómo almacenas la grasa, desgastándote a nivel muscular y debilitando tu sistema inmunológico.</p>\r\n<p style=\"text-align: justify;\">Pero tranquilo, todo tiene solución. !Éstas herramientas te ayudarán a sentirte mejor y a vencer a tu peor enemigo!</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><strong>1. HAZ EJERCICIO</strong></p>\r\n<p style=\"text-align: justify;\">Haciendo ejercicio liberas endorfina (hormona de la felicidad y tranquilidad). Piensa en el ejercicio como una herramienta que te hará sentir mejor, porque te ayudará a regular el sueño y a controlar el apetito. !Empieza a disfrutar la primavera tomando tus 3 clases prueba en Mobius Crossfit Cancún haciendo clic <a href=\"https://www.facebook.com/MobiusCrossfit/app_670522276310483\">aquí</a>.</p>\r\n<p><img src=\"images/Ejercicio.png\" border=\"0\" width=\"400\" height=\"200\" style=\"border: 0;\" /></p>\r\n<p>Foto cortesía de: Gelert</p>\r\n<p> </p>\r\n<p><strong>2. DUERME LO SUFICIENTE </strong></p>\r\n<p>¿Sabías que no dormir engorda? Cuando estás cansado por la falta de sueño empiezas a segregar una hormona que te provoca más hambre y ansiedad por los alimentos con alto contenido de azúcar. Y claro, no es necesario mencionar que el monstruo del mal humor se apodera de ti.</p>\r\n<p><img src=\"images/duerme.png\" border=\"0\" width=\"400\" height=\"400\" style=\"border: 0;\" /></p>\r\n<p> </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><strong>3. APRENDE A RESPIRAR</strong></p>\r\n<p style=\"text-align: justify;\">La meditación es una herramienta increíble. No tienes que ser yogi o un experto en la materia, regálate unos minutos para ti. Concéntrate en inhalar profundo y exhalar lo más lento posible al menos durante 5 minutos. Al contactar con la respiración lograrás calmar la velocidad de tus pensamientos relajando así la mente. El mejor aliado para meditar es tu respiración. </p>\r\n<p><img src=\"images/do%20yoga.png\" border=\"0\" width=\"400\" height=\"200\" style=\"border: 0;\" /></p>\r\n<p style=\"text-align: justify;\">Foto cortesía de: Myurifemm</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><strong>4. COME DE FORMA CONSCIENTE</strong></p>\r\n<p style=\"text-align: justify;\">La comida se debe comer sentado en la mesa. No mientras trabajas, hablas por teléfono o haces cualquier otra cosa, porque tu cerebro no procesa la información por estar concentrado en otra cosa. Sí, como si nos pusieran en piloto automático. El estómago tarda 20 minutos en enviarle al cerebro la señal de que ya está lleno, entonces tómate tu tiempo y pon tus cinco sentidos en la comida. Así disfrutarás más tus alimentos y no dejarás pasar alguna buena plática con tus familiares y amigos.</p>\r\n<p><img src=\"images/meal.png\" border=\"0\" width=\"400\" height=\"600\" style=\"border: 0;\" /></p>\r\n<p>Foto cortesía de: KeepCalmAndPosters</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><strong>5. ¡PIENSA POSITIVO!</strong></p>\r\n<p style=\"text-align: justify;\">Si le ves el lado positivo a todo, las cosas te van a salir mejor. Vas a manejar el estrés y los problemas de una manera saludable que no afectará tu cuerpo y mente de la manera que antes lo hacía. Así que no te frustres por esos kilos de más, aquí en Mobius Crossfit Cancún te ofrecemos todas las herramientas para mejorar tu estilo de vida. Encontrarás una gran comunidad que busca objetivos afines a los tuyos y te apoyará en todo momento. Hasta en esos días donde nada parece ir bien.</p>\r\n<p><img src=\"images/imposible.png\" border=\"0\" width=\"400\" height=\"200\" style=\"border: 0;\" /></p>\r\n<p> Foto cortesía de: Pivcom</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><strong>6. ORGANÍZATE</strong></p>\r\n<p style=\"text-align: justify;\">El trabajo y las responsabilidades del día a día hacen que te olvides de ti. Así que organízate, llévate al trabajo o a la escuela tu comida saludable empacada en vez de comerte la ración de tacos en la esquina. Y si tienes tiempo de ver el capítulo nuevo de tu serie favorita, ¿por qué no vas a tener tiempo para hacer ejercicio? </p>\r\n<p style=\"text-align: justify;\">Uno de los beneficios de CrossFit es que los WODs duran solo una hora y son increíblemente efectivos. ¿No me crees? !Ven a Mobius Crossfit y compruébalo!</p>\r\n<p><img src=\"images/crossfit mom.png\" border=\"0\" alt=\"\" /></p>\r\n<p style=\"text-align: justify;\">Foto cortesía de: If-Fit</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><strong>7. NO TE RINDAS AL ESTRÉS</strong></p>\r\n<p style=\"text-align: justify;\">En esos momentos de mucha ansiedad mueves cielo y tierra con tal de conseguir eso que se te antojó de la tiendita, pero en realidad tenemos que ser más inteligentes. En vez de invertir toda tu energía en un bote de helado y viendo películas  tratando de desestresarte, una de las mejores maneras de liberar la mente por un rato es haciendo ejercicio.</p>\r\n<p><img src=\"images/no te rindas .png\" border=\"0\" alt=\"\" /></p>\r\n<p> Foto cortesía de: BreakBrunch</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><strong>8. INCLUYE EN TU DIETA DIARIA LOS SIGUIENTES ALIMENTOS:</strong></p>\r\n<p style=\"text-align: justify;\">Salmón, nueces, cereales integrales, vegetales, frutas y un par de cuadritos de chocolate para endulzarte la vida. Todos estos alimentos estimulan el buen humor, reducen el estrés y  te dan energía. En las noches tómate un té de manzanilla, camomila o tila porque estimulan el sueño y te ayudan a relajarte. Si estás haciendo el reto paleo y tienes algún malestar o duda no dudes en acercarte a tus coaches que te apoyarán en todo momento.</p>\r\n<p><img src=\"images/real%20food.png\" border=\"0\" width=\"400\" height=\"200\" style=\"border: 0;\" /></p>\r\n<p>Foto cortesía de: Our Little Family Adventure</p>\r\n<p> </p>\r\n<p><strong>9. ¡RíETE!</strong></p>\r\n<p>¡Ésta es la mejor medicina!</p>\r\n<p>CREE EN TI Y RELÁJATE</p>\r\n<p><img src=\"images/rete.png\" border=\"0\" width=\"400\" height=\"200\" style=\"border: 0;\" /></p>\r\n<p> Foto cortesía de: Imágenes para ti.</p>\r\n<p> </p>','',1,0,0,12,'2014-03-21 19:39:01',989,'','2014-03-21 19:44:23',989,0,'0000-00-00 00:00:00','2014-03-21 19:39:01','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":null,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":null,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',2,0,4,'','',1,941,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',1,'*',''),(135,180,'¿Qué comer después de entrenar?','que-comer-despues-de-entrenar','','<p style=\"text-align: justify;\">Típico que empiezas a  hacer ejercicio intenso y tu apetito se duplica .Después de varias semanas de entrenamiento intenso y comiendo lo que encuentres a tu paso, te llevas la sorpresa de que has subido de peso en vez de bajar o que simplemente no logras tonificar esa parte del cuerpo que deseas.</p>\r\n<p style=\"text-align: justify;\">Lo primero que debes saber es que después de cada entrenamiento o desgaste físico llega la “recuperación” que debes darle a tu cuerpo a base de nutrientes. También ten en cuenta que los primeros 30 minutos después de tu entrenamiento son vitales para que consumas las cantidades adecuadas de <strong>líquidos, proteínas y carbohidratos</strong> necesarias, así repararás tus fibras musculares, ayudándolas a crecer fuertes, a mantenerse y recuperarse para estar listas para el próximo entrenamiento.</p>\r\n<p style=\"text-align: justify;\"><img src=\"images/Healthy-Post-Workout-Snacks.jpg\" border=\"0\" width=\"400\" height=\"200\" style=\"border: 0;\" /></p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Ahora la pregunta del millón es ¿Qué debo comer?</p>\r\n<p style=\"text-align: justify;\">Es muy común escuchar a las personas decir que no tienen tiempo de “cocinar”. No te preocupes, comer lo adecuado no quiere decir que deberás pasar muchas horas en la cocina, al contrario te darás cuenta que comer sano es mucho más sencillo y rápido de lo que te imaginas.</p>\r\n<p style=\"text-align: justify;\">La clave está en definir el tiempo que tienes para prepararte tus platillos saludables y en base a esto definir qué te conviene más.</p>\r\n<p style=\"text-align: justify;\">Si eres una persona que trabaja y tienes poco tiempo para cocinar puedes conseguir una proteína de suero de leche (whey), es una excelente opción pues contiene todos los aminoácidos que necesita el cuerpo humano. Su eficiencia metabólica hace que la digieras con mayor facilidad y contienen una concentración de aminoácidos de cadena ramificada, que tus músculos convierten en glucosa, que se usará como energía.</p>\r\n<p style=\"text-align: justify;\">Esta es una gran opción para consumir como alimento de recuperación, lo mejor es que solo necesitas llevar un poco de polvo en un shaker, agregarle agua y tomarlo. </p>\r\n<p style=\"text-align: justify;\">Como es líquida, prácticamente no necesita ser digerida, por lo que va directo a hacer el trabajo de reparación muscular, siendo una de las formas más efectivas de lograr recuperarte tras entrenar.</p>\r\n<p style=\"text-align: justify;\"><img src=\"images/protein-drink-strong-guy.jpg\" border=\"0\" width=\"400\" height=\"200\" style=\"border: 0;\" /></p>\r\n<p style=\"text-align: justify;\">Si tienes más tiempo, puedes preparar los siguientes platillos que también te ayudarn a proporcionarle a tu cuerpo lo que necesitas para recuperarte de manera natural.</p>\r\n<p style=\"text-align: justify;\"><strong>Plátanos machos con una lata de atún</strong></p>\r\n<p style=\"text-align: justify;\">Es muy fácil de preparar solo mezcla el atún con pedazos de plátano, si no te gusta el plátano lo puedes sustituir por camote cocido que tiene textura parecida y un sabor exquisito.</p>\r\n<p style=\"text-align: justify;\"><img src=\"images/url.jpg\" border=\"0\" width=\"400\" height=\"200\" style=\"border: 0;\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Leche con chocolate.</strong></p>\r\n<p style=\"text-align: justify;\">Procura que sea cacao 100% puro y orgánico para aprovechar al máximo los nutrientes.  Puedes encontrarlo en tiendas como Vegan Planet o Las tres puertas.</p>\r\n<p style=\"text-align: justify;\"><img src=\"images/batido-de-chocolate-casero.jpg\" border=\"0\" width=\"400\" height=\"200\" style=\"border: 0;\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Smoothies de proteína con fruta.</strong></p>\r\n<p style=\"text-align: justify;\">Puedes agregarle tu proteína whey o yogurt griego que es más bajo en grasas que el yogurt normal.</p>\r\n<p style=\"text-align: justify;\">Los smoothies son una opción deliciosa y muy rápida para recuperarte, a parte que te los puedes llevar a donde sea cuando sales a las prisas de tu casa.</p>\r\n<p style=\"text-align: justify;\">Las opciones son infinitas para prepararlos, todo depende gustos; Puedes usar leche de vaca o cualquier leche hecha a base de semillas (almendras, semilla de girasol). Para darle el toque final agrégale fibra usando chía o linaza.</p>\r\n<p style=\"text-align: justify;\"><img src=\"images/2f013cd534dd32ae95476714dde286cc.jpg\" border=\"0\" width=\"400\" height=\"600\" style=\"border: 0;\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Pasta con pollo:</strong> Este platillo es el recuperador por excelencia, pues contiene carbohidratos y la proteína del pollo. Si estás buscando otras opciones para sustituir la carne puedes acompañar tu pasta con una ensalada con hojas verdes ( Espinaca, acelga etc) y quinoa que es excelente fuente protéica. (Como tip utiliza arroz y pastas integrales, que te darán la sensación de saciedad por más tiempo).</p>\r\n<p style=\"text-align: justify;\"><img src=\"images/thumb.png\" border=\"0\" width=\"400\" height=\"200\" style=\"border: 0;\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Salmón con arroz</strong></p>\r\n<p style=\"text-align: justify;\">Coloca un filete de salmón a la plancha y acompáñalo con arroz integral.</p>\r\n<p style=\"text-align: justify;\"><img src=\"images/9cd5ae49831e39a72206b269ad230ab2.jpg\" border=\"0\" width=\"400\" height=\"200\" style=\"border: 0;\" /></p>\r\n<p style=\"text-align: justify;\"><strong>Dos huevos cocidos, un vaso con leche y una rebanada de pan.</strong></p>\r\n<p style=\"text-align: justify;\">Recuerda siempre usar opciones integrales,  y para mayor absorción de proteínas puedes usar solo la clara de huevo.</p>\r\n<p style=\"text-align: justify;\"><img src=\"images/getty_rm_photo_of_boiled_egg.jpg\" border=\"0\" width=\"400\" height=\"200\" style=\"border: 0;\" /></p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">La idea es acelerar tu metabolismo, así que los nutriólogos recomiendan tener colaciones entre las comidas.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Te enlistamos los healthy snacks que te puedes llevar a donde sea:</p>\r\n<p style=\"text-align: justify;\">1.-Almendras</p>\r\n<p style=\"text-align: justify;\">2.-Pepino</p>\r\n<p style=\"text-align: justify;\">3.-Bolitas de dátil con nuez.</p>\r\n<p style=\"text-align: justify;\">4.-Una cucharada de mantequilla de maní.</p>\r\n<p style=\"text-align: justify;\">5.- Barritas de granola con cacao natural (No compres las de súper, tienen demasiadas azúcares).</p>\r\n<p style=\"text-align: justify;\">6.- Cualquier fruta es mejor que una bolsa de papas.</p>\r\n<p style=\"text-align: justify;\"><img src=\"images/Captura de pantalla 2014-03-28 a las 17.31.52.png\" border=\"0\" alt=\"\" /></p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Recuerda que el 70% de tus resultados depende de tu alimentación, solo cuida lo que comes y no faltes al box. Notarás resultados muy rápidos, te sentirás con mucha energía y estarás más sano.</p>\r\n<p style=\"text-align: justify;\">Cada cuerpo es diferente así que si necesitas asesoría personalizada te recomendamos visitar a un experto en nutrición. Nosotros recomendamos a la nutrióloga Rosa Irene Campos que nos ha dado excelentes resultados en Möbius Makeover.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p> </p>','',1,0,0,12,'2014-03-28 23:38:02',989,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2014-03-28 23:38:02','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,3,'','',1,1873,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',1,'*',''),(136,181,'W.O.D-01/04/2014','w-o-d-01-04-2014','','<p><img src=\"images/PC082648.JPG\" border=\"0\" alt=\"\" width=\"360\" height=\"250\" /></p>\r\n<p><strong>WO</strong><strong>D</strong></p>\r\n<p>IN TEAMS</p>\r\n<p>Complete 8 min. 40sec on 20 sec off</p>\r\n<p> </p>\r\n<p>Row, max effort</p>\r\n<p> </p>\r\n<p>Double unders</p>\r\n<p> </p>\r\n<p>Then</p>\r\n<p> </p>\r\n<p><strong>AMRAP 8 MIN</strong></p>\r\n<p> </p>\r\n<p>8 Ring dips</p>\r\n<p> </p>\r\n<p>10 Moun