ulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,5,'','',1,75,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(141,186,'W.O.D-21/04/2014','w-o-d-21-04-2014','','<p><img src=\"images/CF-Back-Squat.jpeg\" border=\"0\" alt=\"\" width=\"368\" height=\"281\" /> </p>\r\n<p><strong>WARM UP</strong></p>\r\n<p><strong>3RFT</strong></p>\r\n<p><strong> </strong></p>\r\n<p>15 Wall balls shots (14/10)</p>\r\n<p> </p>\r\n<p>200m Run</p>\r\n<p> </p>\r\n<p>5 c2b pull up</p>\r\n<p> </p>\r\n<p><strong>WOD </strong></p>\r\n<p><strong> </strong></p>\r\n<p><strong><br /></strong>Back squat</p>\r\n<p> </p>\r\n<p>5.5.5.5.5</p>\r\n<p><span>Anuncios:</span></p>\r\n<div>\r\n<div><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\">-Recordar el estacionamiento en la parte de abajo.</span></span></div>\r\n<div><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\">-Hacer check in 10 minutos antes del WOD.</span></span></div>\r\n<div><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\">-Si aún no nos sigues en Facebook regálanos un \"Me Gusta\" o síguenos en Twitter.</span></span></div>\r\n</div>','',1,0,0,10,'2014-04-21 12:25:20',989,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2014-04-21 12:25:20','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,4,'','',1,75,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(142,187,'¿Por qué comemos comida chatarra?','por-que-comemos-comida-chatarra','','<p> </p>\r\n<p style=\"text-align: justify;\">Ciertamente la comida chatarra es adictiva y para muchos de nosotros, deliciosa. Sabemos también que no es saludable ya que se le relaciona con problemas del corazón, hipertensión, y sobrepeso. Quizá también estés al tanto de estudios que muestran que el consumo de estos alimentos, pobres en contenido nutricional, están ligados con alteraciones en el estado de ánimo como la depresión y ansiedad.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Si ya lo sabemos: La comida chatarra es mala, entonces ¿Por qué se nos antoja?</p>\r\n<p style=\"text-align: justify;\"><img src=\"images/susanne_posel_news_-Eating-junk-food1.jpg\" border=\"0\" width=\"600\" height=\"400\" style=\"border: 0;\" /></p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><strong>Steven Whyterly</strong> es un científico que ha investigado los factores que hacen que ciertas comidas sean mas adictivas que otras. En su reporte <strong>Why humans like junk food</strong>, habla de dos factores:</p>\r\n<p style=\"text-align: justify;\">El primer factor se compone de la sensación del sabor (salado, dulce, agridulce), su olor y la sensación de esta comida en la boca. La última es particularmente importante ya que las compañías alimenticias invierten millones de dólares en descubrir  el mayor nivel de satisfacción causado por el “crunch“ de una papa frita. Sus científicos  hacen pruebas para hallar la cantidad exacta de gas en una soda. La combinación adecuada de estos elementos crean una sensación que nuestro cerebro asocia con una determinada bebida o comida en particular. </p>\r\n<p style=\"text-align: justify;\"><img src=\"images/fitfreeze-fights-cravings_a.jpg\" border=\"0\" width=\"600\" height=\"400\" style=\"border: 0;\" /></p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">El segundo aborda la combinación de macronutrientes- la mezcla de proteínas, grasas y carbohidratos contenida. En el caso de la comida chatarra, las compañías alimenticias están en busca del “mix“ adecuado de sal, azúcar y grasas que estimulen al cerebro para seguir consumiendo estos alimentos.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Afortunadamente, no todo esta perdido. Entre menos comida chatarra ingieras habrá una diminución en la sensación de antojo. </p>\r\n<p style=\"text-align: justify;\">Cuando decides dejar de comer comida chatarra entras en un estado de abstinencia donde tal vez sientas ansiedad, dolor de cabeza etc. Todo esto es porque tu cuerpo está liberándose las las toxinas de la \"Junk food\"</p>\r\n<p style=\"text-align: justify;\"><img src=\"images/keep-calm-and-ignore-junk-food.png\" border=\"0\" alt=\"\" /></p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><strong>Tips para evitar la comida chatarra.</strong></p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">1.- Fíjate algún objetivo específico que quieras lograr. Piensa en esa parte del cuerpo que quieres tonificar y asegúrate de empezar a actuar en pro de ese objetivo.</p>\r\n<p style=\"text-align: justify;\">2.- Haz tu compras en los pasillos exteriores del supermercado donde encontrarás alimentos frescos, no procesados y con menos calorías.</p>\r\n<p style=\"text-align: center;\"><img src=\"images/produceVsJunkfood.jpg\" border=\"0\" alt=\"\" /></p>\r\n<p>3.- Procura preparar comidas que impliquen, cuando menos, el uso de 5 ingredientes para mantener interesante la propuesta a tu paladar.</p>\r\n<p>4.-Lidia con el estrés mediante técnicas de reparación y meditación para no buscar la gratificación instantánea de los alimentos chatarra.</p>\r\n<p style=\"text-align: justify;\">5.- Sé constante y realiza actividades físicas con regularidad. Cuando realizas ejercicio tiendes a tener una menor atracción por comida alta en calorías ya que a través del sudor, tu cuerpo también se libera de las toxinas y el estrés. Así que si ya eres parte de nuestra comunidad de <strong>CrossFit</strong> en <strong>Cancún</strong> llevas las de ganar. </p>\r\n<p style=\"text-align: justify;\">Recuerda <strong>\"Abs are made in the kitchen\",</strong> lo que comes es lo que determinará tus resultados de <strong>fitness.</strong> Elige bien y recuerda que tienes un staff de fanáticos del bienestar que te apoyarán en todo momento. #Fuerza</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>','',1,0,0,12,'2014-04-21 23:02:22',989,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2014-04-21 23:02:22','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,2,'','',1,497,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',1,'*',''),(143,188,'W.O.D-23/04/2014','w-o-d-23-04-2014','','<p><img src=\"images/butterfly-kipping-pull-ups-technique-trojan-crossfit-wod-la-vida-loca-3-rounds-for-time-shuttle-sprints-running-turf-track-deadlifts-burpee-box-jumps-chest-to-bar-pullups-c2b.jpg\" border=\"0\" alt=\"\" width=\"360\" height=\"238\" /></p>\r\n<p><strong>WOD</strong></p>\r\n<p><strong>\"HELEN\"</strong></p>\r\n<p><strong> </strong></p>\r\n<p><strong><br /></strong>400M Run</p>\r\n<p> </p>\r\n<p>21 Kb swings (24(16)kg</p>\r\n<p> </p>\r\n<p>12 Pull ups</p>\r\n<p> </p>\r\n<p> </p>\r\n<p><strong> </strong></p>\r\n<p>Anuncios:</p>\r\n<div>\r\n<div><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\">-Recordar el estacionamiento en la parte de abajo.</span></span></div>\r\n<div><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\">-Hacer check in 10 minutos antes del WOD.</span></span></div>\r\n<div><span style=\"color: #222222; font-size: small;\"><span style=\"line-height: normal;\">-Si aún no nos sigues en Facebook regálanos un \"Me Gusta\" o síguenos en Twitter.</span></span></div>\r\n</div>','',1,0,0,10,'2014-04-23 12:54:42',989,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2014-04-23 12:54:42','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,3,'','',1,74,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(144,189,'CrossFit en tu Cama','crossfit-en-tu-cama','','<p style=\"text-align: justify;\">Curiosamente el sexo y el ejercicio tienen ciertas similitudes que nos develan una línea muy tenue entre sí. Piénsalo bien; cuando realizas un <strong>WOD</strong>  transpiras, respiras fuerte, aceleras tu ritmo cardiaco, quemas calorías y obtienes una sensación de satisfacción causada por endorfinas y cuando tienes sexo, también. </p>\r\n<p style=\"text-align: justify;\"><img src=\"images/Blog-post-header_630x264_RBK-Crossfit.jpg\" border=\"0\" alt=\"\" /></p>\r\n<p><strong>Impacto del ejercicio en tu vida sexual</strong></p>\r\n<p style=\"text-align: justify;\">Un estudio de la Universidad de Texas reveló que la actividad física prepara la susceptibilidad del cuerpo de las mujeres hacia la excitación sexual.</p>\r\n<p style=\"text-align: justify;\">Las mujeres involucradas en el estudio se dividieron en dos grupos: quienes fueron sometidas a una sesión de  20 minutos de bicicleta fija y quienes no. Posterior a la actividad física se proyectaron dos películas, la primera de viajes y un filme erótico. En el grupo de las mujeres que realizaron actividad física, los resultados arrojaron que los niveles de flujo sanguíneo en la zona genital eran más altos. Es decir, mostraban (objetivamente) un mayor nivel de excitación.</p>\r\n<p style=\"text-align: justify;\"><img src=\"images/falta-de-deseo-sexual-599so012612.jpg\" border=\"0\" alt=\"\" /></p>\r\n<p><strong>¿Y en los hombres?</strong></p>\r\n<p><span style=\"text-align: justify;\">Si bien en mujeres la falta de apetito sexual es uno de los principales problemas en este rubro, los hombres encuentran su némesis en la disfunción eréctil. Las enfermedades cardiovasculares y los trastornos afectivos como el estrés, depresión y ansiedad son una de las principales causas a este incómodo padecimiento. Afortunadamente, en Möbius prevenimos padecimientos cardiovasculares y los trastornos enunciados a través movimientos funcionales realizados a alta intensidad.</span></p>\r\n<p><img src=\"images/wod-ejemplo-magen.jpg\" border=\"0\" alt=\"\" /></p>\r\n<p><strong>Cuestión de autoestima</strong></p>\r\n<p>Si tengo una actividad física constante, me siento contento, me veo mejor y mi deseo sexual aumenta. Tiene sentido ¿no crees?. Es un círculo, parte de un ciclo; el ejercicio, además de la relación directa con el incremento en la susceptibilidad de la excitación, dispara factores importantes en nuestra vida que a su vez contribuyen a una mejor vida sexual. </p>\r\n<p style=\"text-align: justify;\"><img src=\"images/b94693b6fb69375477fb94beba81147f.jpg\" border=\"0\" alt=\"\" /></p>','',1,0,0,12,'2014-05-01 15:24:38',989,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','2014-05-01 15:24:38','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',1,0,1,'','',1,424,'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',1,'*',''),(145,190,'W.O.D-12/05/2014','w-o-d-12-05-2014','','<p><img src=\"images/CF-Back-Squat.jpeg\" border=\"0\" alt=\"\" width=\"371\" height=\"283\" /></p>\r\n<p><strong>WOD</strong></p>\r\n<p><strong>WARM UP </strong></p>\r\n<p><strong>3RFT</strong></p>\r\n<p><strong> </strong></p>\r\n<p>300m Run</p>\r\n<p>20 Squats</p>\r\n<p>15 Push ups</p>\r\n<p>10 Pull ups</p>\r\n<p> </p>\r\n<p><strong>WOD</strong></p>\r\n<p>\" Isabel\" 30 snatches for time (135/95)</p>\r\n<p> </p>\r\n<p><strong> </strong></p>\r\n<p>Anuncios:</p>\r\n<div>\r\n<div><span style=\"color: #222222; fon