robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',0,'*',''),(147,192,'¿Qué son los Superfoods?','que-son-los-superfoods','','<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">Los <strong>superfoods</strong> son alimentos 100% naturales (frutas-algas-semillas-raíces o hierbas) que contienen una densidad sumamente alta de nutrientes en tan solo pequeñas cantidades. Son llamados de esta forma por ser fuentes superiores de antioxidantes y nutrientes esenciales que necesitamos para un adecuado funcionamiento fisiológico pero que nuestro cuerpo no los puede producir por sí solo. Estos además de nutrir el cuerpo, ayudan a desintoxicar el organismo, aumentan la energía, mejoran la inmunidad y el bienestar general. Asimismo los superfoods al ser salvajes o enteros a diferencia de las vitaminas y minerales sintéticos, se absorben y se utilizan de manera sumamente eficiente dentro de nuestro organismo.</p>\r\n<p><img src=\"images/mosaico superfoods.jpg\" border=\"0\" alt=\"\" /></p>\r\n<p>Estos super foods los puedes encontrar en tiendas orgánicas como las tres puertas o vegan planet en Cancún.</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\">Te enlistamos los principales Superfoods y sus beneficios.</p>\r\n<p style=\"text-align: justify;\"><strong>Wheatgrass</strong></p>\r\n<p style=\"text-align: justify;\">-Purifica y limpia la sangre</p>\r\n<p style=\"text-align: justify;\">-Alcaliniza y equilibra el Ph de tu cuerpo</p>\r\n<p style=\"text-align: justify;\">-Ayuda en la desintoxicación del hígado</p>\r\n<p style=\"text-align: justify;\">-Es antibacteriano y antiviral</p>\r\n<p style=\"text-align: justify;\">-Nutre el cerebro y el sistema inmunológico</p>\r\n<p style=\"text-align: justify;\">-Regula el metabolismo</p>\r\n<p style=\"text-align: justify;\">-Previene las enfermedades degenerativas</p>\r\n<p style=\"text-align: justify;\">-Mejora el aliento</p>\r\n<p style=\"text-align: justify;\">-Ayuda a reducir la presión arterial</p>\r\n<p style=\"text-align: justify;\">- 30ml equivalen a casi dos kilos de vegetales crudos</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\"><strong>Chía</strong></p>\r\n<p style=\"text-align: justify;\">-Omega 3 y 6 o solo 3</p>\r\n<p style=\"text-align: justify;\">-Mejora el funcionamiento del corazón</p>\r\n<p style=\"text-align: justify;\">-Disminuyen el apetito</p>\r\n<p style=\"text-align: justify;\">-Gran fuente de calcio</p>\r\n<p style=\"text-align: justify;\">-Energía constante que no altera el sistema nervioso</p>\r\n<p style=\"text-align: justify;\">-Por su gran capacidad de absorción de agua, te mantiene hidratado todo el día</p>\r\n<p style=\"text-align: justify;\">-Estabiliza el azúcar en la sangre</p>\r\n<p><img src=\"images/chia.jpg\" border=\"0\" alt=\"\" /></p>\r\n<p> </p>\r\n<p><strong>Cacao</strong></p>\r\n<p>-Ayuda  a bajar de peso</p>\r\n<p>-Regula el azúcar en la sangre</p>\r\n<p>-Es afrodisíaco</p>\r\n<p>-Ayuda a tratar la depresión</p>\r\n<p>-Alto contenido de magnesio, hierro y  cromo</p>\r\n<p>-Es el mejor antioxidante natural</p>\r\n<p>-Baja el colesterol</p>\r\n<p>-Alivia el estrés</p>\r\n<p>-Reduce el riesgo de padecer cáncer</p>\r\n<p>-Mejora la visión</p>\r\n<p> </p>\r\n<p><strong> </strong></p>\r\n<p><strong>MSM Powder</strong></p>\r\n<p>-Ayuda en el tratamiento de dolores fuertes (es un analgésico natural)</p>\r\n<p>-Potencializa la absorción de vitaminas y nutrientes</p>\r\n<p>-Es un antioxidante natural</p>\r\n<p>-Desintoxica tu cuerpo</p>\r\n<p>-Mejora el funcionamiento del cerebro</p>\r\n<p>-Ayuda a tratar las alergias</p>\r\n<p>-Protege contra parásitos</p>\r\n<p>-Auxiliar en el tratamiento de cáncer</p>\r\n<p>-Mejora el sistema digestivo</p>\r\n<p>-Controla la diabetes</p>\r\n<p>-Desestresante natural</p>\r\n<p>-Mejora la apariencia de la piel</p>\r\n<p>-Ayuda a producir tu propio colágeno</p>\r\n<p> </p>\r\n<p><strong>Goji berry</strong></p>\r\n<p>-Incrementa tu energía y tu fuerza</p>\r\n<p>-Mejora la apariencia de la piel</p>\r\n<p>-Disminuye la presión sanguínea</p>\r\n<p>-Combate la inflamación</p>\r\n<p>-Protege el hígado</p>\r\n<p>-Mejora la fertilidad</p>\r\n<p>-Inhibe el crecimiento de tumores</p>\r\n<p>-Aumenta la libido y la función sexual</p>\r\n<p>-Ayuda en la pérdida de peso</p>\r\n<p>-Mejora la visión</p>\r\n<p>-Alto en antioxidantes</p>\r\n<p>-Contribuye al proceso digestivo</p>\r\n<p><img src=\"images/goji berry.jpg\" border=\"0\" alt=\"\" /></p>\r\n<p> </p>\r\n<p><strong>Hemp</strong></p>\r\n<p>-Mantiene sano al corazón</p>\r\n<p>-Nivela el colesterol en la sangre</p>\r\n<p>-Evita la acumulación de grasa en las arterias</p>\r\n<p>-Excelente fuente de Omega 3 y 6</p>\r\n<p>-Proteína de origen vegetal</p>\r\n<p>-Limpia el Hígado</p>\r\n<p> </p>\r\n<p><strong>Probióticos</strong></p>\r\n<p>-Regula la flora intestinal</p>\r\n<p>-Mejora la tolerancia a la lactosa</p>\r\n<p>-Previene enfermedades respiratorias</p>\r\n<p>-Mejora las defensas y estimula el sistema inmunológico</p>\r\n<p>-Ayuda en la tolerancia alimenticia</p>\r\n<p>-Mejora la colitis</p>\r\n<p> </p>\r\n<p><strong>Maca</strong></p>\r\n<p>-Aumenta la fuerza</p>\r\n<p>-Mejora la libido</p>\r\n<p>-Mejora el rendimiento deportivo</p>\r\n<p>-Regula el sistema endocrino</p>\r\n<p>-Es un analgésico natural</p>\r\n<p>-Balance hormonal</p>\r\n<p><img src=\"images/maca.jpeg\" border=\"0\" alt=\"\" /></p>\r\n<p><strong> </strong></p>\r\n<p><strong> </strong></p>\r\n<p><strong>Lúcuma</strong></p>\r\n<p>-Disminuye la probabilidad de ataques cardíacos</p>\r\n<p>-Mejora el sistema inmunológico</p>\r\n<p>-Auxiliar en el tratamiento de la depresión</p>\r\n<p>-Provee energía al cuerpo</p>\r\n<p>-Reduce el nivel de colesterol en la sangre</p>\r\n<p>-Regula los triglicéridos</p>\r\n<p> </p>\r\n<p><strong>Moringa</strong></p>\r\n<p>-Incrementa las defensas naturales del cuerpo</p>\r\n<p>-Controla el colesterol</p>\r\n<p>-Controla el nivel de azúcar en la sangre</p>\r\n<p>-Reduce la aparición de arrugas y líneas finas</p>\r\n<p>-Promueve el funcionamiento normal del hígado y el riñón</p>\r\n<p>-Embellece la piel</p>\r\n<p>-Proporciona energía</p>\r\n<p>-Promueve una correcta digestión</p>\r\n<p>-Actúa como antioxidante</p>\r\n<p>-Es un anti-inflamatorio natural</p>\r\n<p> </p>\r\n<p><strong>Acaí</strong></p>\r\n<p>-Aumenta  la energía</p>\r\n<p>-Ayuda a la digestión</p>\r\n<p>-Baja el colesterol</p>\r\n<p>-Mejora el sistema digestivo</p>\r\n<p>-Fortalece el sistema inmunológico</p>\r\n<p>-Ayuda a la concentración y mejora la memoria</p>\r\n<p>-Mejora la circulación sanguínea</p>\r\n<p>-Ayuda a bajar de peso naturalmente </p>\r\n<p>-Es un antioxidantes natural</p>\r\n<p>- Alto en antioxidantes</p>\r\n<p><img src=\"images/acai.jpg\" border=\"0\" alt=\"\" /></p>\r\n<p><strong>Fitoplancton</strong></p>\r\n<p>-Mejora el sistema cardiovascular</p>\r\n<p>-Contiene todos los aminoácidos esenciales para el cuerpo humano</p>\r\n<p>-Regula el colesterol</p>\r\n<p>-Mantiene las articulaciones con buen funcionamiento</p>\r\n<p>-Mejora la apariencia de la piel</p>\r\n<p>-Mejora la visión</p>\r\n<p>-Ayuda al funcionamiento del hígado</p>\r\n<p>-Regula y mejora el sueño</p>\r\n<p>-Regula el azúcar en la sangre</p>\r\n<p>-Alto desintoxicante</p>','',1,0,0,12,'2014-05-21 22:44:07',989,'','2014-05-21 22:52:59',989,0,'0000-00-00 00:00:00','2014-05-21 22:44:07','0000-00-00 00:00:00','{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}','{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}','{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_