ass=\"container-fluid crossfitinfocontent sinmargen tab-pane quescrossfit que_es_crossfit_info\"><!--div class=\"cerrar_descurso\"></div-->\r\n<div class=\"span6\">\r\n<div id=\"contenido_que_es\">\r\n<div class=\"descripcion_info_mobius\">\r\n<p><span>\"Movimientos funcionales, constantemente variados, realizados a alta intensidad para obtener un estado físico de fitness completo y, por tanto, estar preparado para cualquier reto físico.\"</span></p>\r\n<p>- Cortesía de CrossFit Inc.</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"span6\">\r\n<div class=\"video span12\">{videobox}mlVrkiCoKkg{/videobox}</div>\r\n</div>\r\n</div>\r\n<div id=\"mitos_del_crossfit_info\" class=\"container-fluid crossfitinfocontent sinmargen tab-pane mitos_del_crossfit_info mitos\">\r\n<div class=\"span12 borde_derecho\">\r\n<div id=\"contenido_mitos\">\r\n<p>CrossFit es sólo para hombres. <span class=\"falso\">Falso.</span></p>\r\n<p>Para entrar a CrossFit debo tener un alto rendimiento. <span class=\"falso\">Falso.</span></p>\r\n<p>CrossFit sólo tiene un nivel: DIFÍCIL. <span class=\"falso\">Falso.</span></p>\r\n<p>En CrossFit te obligaremos a revolcarte en <br /> el lodo mientras te gritamos para animarte. <span class=\"falso\">Falso.</span></p>\r\n<p>CrossFit estimula el crecimiento exagerado de masa muscular. <span class=\"falso\">Falso.</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div id=\"acerca_de_mobius_info\" class=\"container-fluid crossfitinfocontent sinmargen tab-pane acerca_de_mobius_info conoce-mobius\"><!--div class=\"cerrar_descurso\"></div-->\r\n<div class=\"span12\">\r\n<div id=\"contenido_conoce_mobius\">\r\n<div class=\"conoce_info_mobius\">\r\n<p>En Möbius somos un equipo apasionado por el deporte, la salud y el bienestar, como la palabra lo dice “bien – estar” va más allá de sólo hacer ejercicio. En Möbius vas a encontrar profesionales que te llevarán a encontrar un estilo de vida donde la prioridad es tu salud. Desde una correcta alimentación, mantenimiento a nuestro cuerpo con profesionales en Fisioterapia, quiropráctica. Un correcto régimen de entrenamiento de menos a más según tus necesidades y habilidades. En Möbius encontrarás una atmósfera de equipo donde es igual de importante el último en terminar el WOD (Workout of the day) así como el primero. No te dejaremos renunciar, será la mejor manera de alcanzar tus metas de fitness, es más que sólo ir a hacer ejercicio, es una competencia contigo mismo donde la batalla puede ser poder ejecutar una lagartija, hasta una sentadilla de 300kg. Depende de ti y el equipo de Möbius estará cuidándote en cual quiera que sea tu meta.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>',1,'crossfit-info',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',0,'mod_custom',1,1,'{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":\"1\",\"cache_time\":\"900\",\"cachemode\":\"static\"}',0,'*'),(93,'otros eventos','','<div class=\"items-home span4 text-center\">\r\n<h4>ENCUÉNTRANOS</h4>\r\n<div class=\"imgs\"><a href=\"index.php?option=com_content&amp;view=article&amp;id=6&amp;Itemid=122\"><img src=\"templates/mobiuscrossfitcancn/images/webcuts/ubicacion.png\" border=\"0\" /></a></div>\r\n</div>\r\n<div class=\"items-home span4 text-center\">\r\n<h4>HORARIOS</h4>\r\n<div class=\"imgs\"><a href=\"index.php?option=com_content&amp;view=article&amp;id=3&amp;Itemid=104\"><img src=\"templates/mobiuscrossfitcancn/images/webcuts/horarios.png\" border=\"0\" /></a></div>\r\n</div>\r\n<div class=\"items-home span4 text-center \" style=\"border: none;\">\r\n<h4>DROP-IN</h4>\r\n<div class=\"imgs\">\r\n<div style=\"cursor: pointer;\" data-toggle=\"modal\" data-target=\"#myModal2\"><img src=\"images/drop-in-icon.png\" border=\"0\" /></div>\r\n</div>\r\n</div>',1,'eventos',0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00',1,'mod_custom',1,1,'{\"prepare_content\":\"0\",\"backgroundimage\":\"\",\"layout\":\"_:defau